import React, { useState, useEffect } from 'react';

const testImageUrl = async (url) => {
  try {
    const response = await fetch(url, { method: 'HEAD' });
    return response.ok;
  } catch (error) {
    return false;
  }
};

const Results = ({ content, mode}) => {
  const [images, setImages] = useState([]);

  if (content === null) {
    return (
      <p>null</p>
    )
  } else if (content === "400") {
    return (
      <p>invalid input</p>
    )
  }
  else {
    try {
      var output = content;
      console.log(output)
      if (mode == "default" || mode == "every") {
        return (
          <div className="grid-container">
            {output.map((item, index) => (
              <div className="grid-item" key={index}>
                <div id="image-container">
                  <img src={item[2]} alt={item[0]} />
                </div>
                <h3>{item[0] ? item[0] : "<no-name>"}</h3>
                <p>{item[1]}</p>
                <a href={item[4]} target="_blank" rel="noopener noreferrer">View On Opensea</a>
              </div>
            ))}
          </div>
        );
      } else if (mode == "listed") {
        return (
          <div className="grid-container">
            {output.map((item, index) => (
              <div className="grid-item" key={index}>
                <div id="image-container">
                  <img src={item[3]} alt={item[2]} />
                </div>
                <h3>{item[2] ? item[2] : "<no-name>"}</h3>
                <p>{item[0]}</p>
                <div>
                  <p>{String(Math.round(item[4] * 10000) / 10000) + "ETH"}</p>
                  <a href={item[5]} target="_blank" rel="noopener noreferrer">View On Opensea</a>
                </div>
              </div>
            ))}
          </div>
        );
      }
    } catch {
      return (
        <p>Unknown error</p>
      )
    }
  }
};


export default Results;
